css:
.github-DialogPrompt {
  margin: 10px;
  text-align: center;
  font-size: 1.2em;
  user-select: none;
}
.github-DialogForm {
  display: flex;
  flex-direction: column;
  padding: 5px;
}
.github-DialogLabel {
  flex: 1;
  margin: 5px;
  position: relative;
  line-height: 2;
}
.github-DialogLabel--horizontal {
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
  align-items: center;
}
.github-DialogLabel--horizontal input {
  margin: 0 10px;
}
.github-DialogLabel--horizontal input[type="text"],
.github-DialogLabel--horizontal input[type="password"] {
  width: 85%;
}
.github-DialogLabel .github-AtomTextEditor-container {
  margin-top: 5px;
}
.github-DialogInfo {
  display: inline-block;
}
.github-DialogInfo li {
  display: inline-block;
}
.github-DialogFooter {
  display: flex;
  flex-direction: row;
  align-items: center;
}
.github-DialogInfo {
  flex-grow: 1;
  margin: 5px;
  padding: 5px;
}
.github-DialogButtons {
  flex-grow: 0;
  display: flex;
  align-items: center;
  justify-content: flex-end;
  padding: 5px;
}
.platform-win32 .github-DialogButtons {
  flex-direction: row-reverse;
  justify-content: flex-start;
}
.github-DialogButtons .btn {
  margin: 5px;
}
.github-DialogButtons-leftItem,
.github-DialogButtons-leftItem.btn {
  margin: 5px;
  margin-right: auto;
}
.github-Dialog--insetButton {
  position: absolute;
  background: transparent;
  right: 1em;
  top: 0;
  bottom: 0;
  border: none;
  color: rgba(189, 189, 189, 0.35);
  cursor: pointer;
}
.github-Dialog--insetButton:hover {
  color: #bdbdbd;
}
.github-Dialog--insetButton:focus {
  border: solid 1px #353535;
  border-radius: 4px;
}
.github-DialogSpinner {
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px;
}
.github-DialogSpinner .loading {
  margin: 10px;
}
.github-Dialog atom-text-editor[mini].editor {
  margin: 0;
}
.github-Dialog atom-text-editor[mini].editor[readOnly] {
  color: rgba(189, 189, 189, 0.35);
}
.github-Dialog:not(:focus-within) {
  padding-bottom: 1px;
  transition: padding-bottom 0.01s;
}
